import React from "react";
import {useState,useEffect} from "react";

function App() {
  const [todoList, setTodoList] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/')
    .then((res)=>res.json())
    .then((data)=>setTodoList(data));
  }, [])

  return (
    <div>
      <h1>햅삐HaPPPPy</h1>
      <div>
            {todoList.map(user => {
                return (<div>
                    {user.name}
                </div>)
            })}
        </div>
    </div>
  );
}

export default App;
